import Paper from '@mui/material/Paper';
import jwt_decode from "jwt-decode";
import {useNavigate} from "react-router-dom"
import { useEffect, useState } from "react";

const CLIENT_ID= '61992319078-23ghu3p9na3vjc5qi4fg3mcr2mpgbncp.apps.googleusercontent.com';


function Login({setUser})
{
    const [googleToken, setGoogleToken]= useState(null);

    useEffect(() => {
        const googleJWT = googleResponse.credential;
        localStorage.setItem('googleToken', JSON.stringify(googleJWT));
        fetch('http://localhost:5000/login', {method: "post", body: {googleToken}})
        .then( username => {setUser(username)})
        .catch(err => console.log(err));
    }, [googleToken]);

    return (
        <div className="login-page" >
            <Paper className="login-paper" >
                <h1>In The Office</h1>
                <GoogleOAuthProvider clientId={CLIENT_ID}>
                    <GoogleLogin theme="filled_blue"  shape="circle"
                    onSuccess={credentialResponse => setGoogleToken(credentialResponse)}
                    onError={() => console.log('Login Failed')}
                    />
                </GoogleOAuthProvider>
            </Paper>
        </div>
    );
}

export default Login;
